import React, { useState } from "react";
import "./Categorie.module.css";
import classes from "./Categorie.module.css";
import categorieImage from "../../../assets/images/3.webp";

const Categorie = () => {
  const [isCategorie, setIsCategorie] = useState(false);

  const onClickHandle = () => {
    setIsCategorie(true);
  };

  return (
    <div className={classes.categorie} onClick={onClickHandle}>
      <img src={categorieImage} alt="categorie" />
    </div>
  );
};

export default Categorie;
